import { View, Text, StyleSheet, ImageBackground, Image } from 'react-native'
import React from 'react'
import HeaderBgImage from "../images/loginBg.jpg";
import { AntDesign } from '@expo/vector-icons'; 
import BottomNavigation from '../components/component/Bottom-navigation';

export default function Quotation() {
  return (
    <View style={styles.container}>
    <View style={styles.quotationTopCotainer}>
       <ImageBackground source={HeaderBgImage} resizeMode="cover" style={{flex:1}}>
           <View style={styles.titleContainer}>
               <Text style={styles.hireTitle}>THE LARGEST</Text>
               <Text style={styles.hireTitle}>EQUIPMENT RENTAL NETWORK</Text>
           </View>
       </ImageBackground>
    </View>
    <View style={styles.quotationArea}>
          <View>
             <Text style={styles.quotTitle}>Quotation</Text>
          </View>
          <View style={styles.equipment}>
            <View>
                 <Text style={styles.equTitle}>Equipment-1</Text> 
            </View>
            <View>
               <AntDesign name="delete" size={30} color="red" />
            </View>
          </View>
    </View>
     <View style={styles.quotationBottomArea}>
            <BottomNavigation/>
     </View>
</View>
  )
}

const styles = StyleSheet.create({
    container:{
     flex:1,
    },
    quotationTopCotainer:{
      flex:0.5,
      borderBottomRightRadius:40,
      borderBottomLeftRadius:40,
      overflow:"hidden"
    },
    quotationArea:{
      flex:1,
      alignItems:"center",
    },
    titleContainer:{
        flex:1,
        justifyContent:"center",
        alignItems:"center"
    },
    hireTitle:{
        fontSize:15,
        textAlign:"center",
        color:"#fff",
        
    },
    quotationBottomArea:{
        flex: 0.1,
        flexDirection:"row",
        alignItems:"flex-end",
        justifyContent:"space-around",
        backgroundColor:"#fff",
        paddingTop:10
    },
    quotTitle:{
        fontSize:24,
        color:"#f6921e"
    },
    equipment:{
        flexDirection:"row",
        justifyContent:"space-between",
        width:"100%",
        paddingLeft:10,
        paddingRight:10,
        borderColor: '#fff',
        borderWidth: 2,
    },
    equTitle:{
       fontSize:20,
       color:"red",
    }


    

    
})
